import React, { Component } from 'react';
import './Menu.css';

class Menu extends Component {
  render() {
    let linksMarkUp = this.props.links.map((link, index) => {
      return(
        <li className = "menu-item col-md-3"><a href={link.link}>{link.label} </a></li>
      );      
    });   //pobieranie listy links z app.js
    return(
      <nav className = "col-12">
        <div className = "menu row">
          <div className = "border logo col-md-2"></div>
          <div className = "border col-md-7 offset-md-2 hidden-sm-down">
            <ul className = "menu-list col-md-10 offset-md-1">
              {linksMarkUp}
            </ul>
          </div>

        </div>  
      </nav>
    );
  }
}

export default Menu;
